import React from 'react';
import Link from 'next/link';

import * as S from './PlanetCardStyles';

const PlanetCard = ({ name, image, url }) => {
  return (
    <S.PlanetCard>
      <Link href="/planets/[stub]" as={url} passHref>
        <a href={url}>
          <S.Image src={image} alt={`${name} landscape`} />
          <S.Name>{name}</S.Name>
        </a>
      </Link>
    </S.PlanetCard>
  );
};

export default PlanetCard;
